fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:continuant rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :continuant ;
            owl:onProperty :part_of ],
        :entity ;
    owl:disjointWith [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :occurrent ],
        :occurrent ;
    :has_definition "An entity that exists in full at any time in which it exists at all, persists through time while maintaining its identity and has no temporal parts."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:occurrent rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :occurrent ;
            owl:onProperty :part_of ],
        :entity ;
    owl:disjointWith [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :continuant ] ;
    :has_definition "An entity that has temporal parts and that happens, unfolds or develops through time."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:independent_continuant rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :independent_continuant ;
            owl:onProperty :part_of ],
        :continuant ;
    owl:disjointWith :generically_dependent_continuant,
        :specifically_dependent_continuant ;
    :has_definition "A continuant that is a bearer of quality and realizable entity entities, in which other entities inhere and which itself cannot inhere in anything."@en,
        "b is an independent continuant = Def. b is a continuant which is such that there is no c and no t such that b s-depends_on c at t. (axiom label in BFO2 Reference: [017-002])"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:process rdfs:subClassOf :occurrent ;
    :has_definition "An occurrent that has temporal proper parts and for some time t, p s-depends_on some material entity at t."@en,
        "p is a process = Def. p is an occurrent that has temporal proper parts and for some time t, p s-depends_on some material entity at t. (axiom label in BFO2 Reference: [083-003])"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:realizable_entity rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :realizable_entity ;
            owl:onProperty :part_of ],
        :specifically_dependent_continuant ;
    owl:disjointWith :quality ;
    :has_definition "A specifically dependent continuant  that inheres in continuant  entities and are not exhibited in full at every time in which it inheres in an entity or group of entities. The exhibition or actualization of a realizable entity is a particular manifestation, functioning or process that occurs under certain circumstances."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:quality rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :quality ;
            owl:onProperty :part_of ],
        :specifically_dependent_continuant .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:specifically_dependent_continuant rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :specifically_dependent_continuant ;
            owl:onProperty :part_of ],
        :continuant ;
    owl:disjointWith :generically_dependent_continuant ;
    :has_definition "A continuant that inheres in or is borne by other entities. Every instance of A requires some specific instance of B which must always be the same."@en,
        "b is a relational specifically dependent continuant = Def. b is a specifically dependent continuant and there are n &gt; 1 independent continuants c1, … cn which are not spatial regions are such that for all 1  i &lt; j  n, ci  and cj share no common parts, are such that for each 1  i  n, b s-depends_on ci at every time t during the course of b’s existence (axiom label in BFO2 Reference: [131-004])"@en,
        "b is a specifically dependent continuant = Def. b is a continuant & there is some independent continuant c which is not a spatial region and which is such that b s-depends_on c at every time t during the course of b’s existence. (axiom label in BFO2 Reference: [050-003])"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:role rdfs:subClassOf :role ;
    owl:equivalentClass :role ;
    :has_definition "A realizable entity  the manifestation of which brings about some result or end that is not essential to a continuant  in virtue of the kind of thing that it is but that can be served or participated in by that kind of continuant  in some kinds of natural, social or institutional contexts."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:generically_dependent_continuant rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :generically_dependent_continuant ;
            owl:onProperty :part_of ],
        :continuant ;
    :has_definition "A continuant that is dependent on one or other independent continuant bearers. For every instance of A requires some instance of (an independent continuant type) B but which instance of B serves can change from time to time."@en,
        "b is a generically dependent continuant = Def. b is a continuant that g-depends_on one or more other entities. (axiom label in BFO2 Reference: [074-001])"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:process_boundary rdfs:subClassOf :occurrent ;
    :has_definition "p is a process boundary =Def. p is a temporal part of a process & p has no proper temporal parts. (axiom label in BFO2 Reference: [084-001])"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:material_entity rdfs:subClassOf :independent_continuant ;
    owl:disjointWith [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :immaterial_entity ],
        :immaterial_entity ;
    :has_definition "An independent continuant that is spatially extended whose identity is independent of that of other entities and can be maintained through time."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:material_entity rdfs:subClassOf :independent_continuant ;
    owl:disjointWith [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :immaterial_entity ],
        :immaterial_entity ;
    :has_definition "An independent continuant that is spatially extended whose identity is independent of that of other entities and can be maintained through time."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:continuant_fiat_boundary rdfs:subClassOf :immaterial_entity ;
    :has_definition "b is a continuant fiat boundary = Def. b is an immaterial entity that is of zero, one or two dimensions and does not include a spatial region as part. (axiom label in BFO2 Reference: [029-001])"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immaterial_entity rdfs:subClassOf :independent_continuant ;
    owl:disjointWith [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :material_entity ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gas_molecular_entity rdfs:subClassOf :main_group_molecular_entity ;
    :has_definition "Any main group molecular entity that is gaseous at standard temperature and pressure (STP; 0degreeC and 100 kPa)." ;
    :has_related_synonym "gas molecular entities",
        "gaseous molecular entities",
        "gaseous molecular entity" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glycan rdfs:subClassOf :carbohydrates_and_carbohydrate_derivatives ;
    :has_definition "Any oligosaccharide, polysaccharide or their derivatives consisting of monosaccharides or monosaccharide derivatives linked by glycosidic bonds. See also http://www.ontobee.org/ontology/GNO?iri=http://purl.obolibrary.org/obo/GNO_00000001." ;
    :has_related_synonym "glycans" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iron_atom rdfs:subClassOf :iron_group_element_atom ;
    :has_definition "An iron group element atom that has atomic number 26." ;
    :has_exact_synonym "iron" ;
    :has_related_synonym "26Fe",
        "Eisen",
        "Fe",
        "Iron",
        "fer",
        "ferrum",
        "hierro",
        "iron" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anion rdfs:subClassOf :ion ;
    :has_definition "A monoatomic or polyatomic species having one or more elementary charges of the electron." ;
    :has_exact_synonym "Anion",
        "anion" ;
    :has_related_synonym "Anionen",
        "aniones",
        "anions" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:molecular_entity rdfs:subClassOf :chemical_entity ;
    :has_definition "Any constitutionally or isotopically distinct atom, molecule, ion, ion pair, radical, radical ion, complex, conformer etc., identifiable as a separately distinguishable entity." ;
    :has_exact_synonym "molecular entity" ;
    :has_related_synonym "entidad molecular",
        "entidades moleculares",
        "entite moleculaire",
        "molecular entities",
        "molekulare Entitaet" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chemical_entity rdfs:subClassOf :material_entity ;
    :has_definition "A chemical entity is a physical entity of interest in chemistry including molecular entities, parts thereof, and chemical substances." ;
    :has_exact_synonym "chemical entity" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:biological_role rdfs:subClassOf :role ;
    :has_definition "A role played by the molecular entity or part thereof within a biological context." ;
    :has_related_synonym "biological function" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydroxides rdfs:subClassOf :heteroatomic_molecular_entity,
        :hydrogen_molecular_entity,
        :oxygen_molecular_entity ;
    :has_definition "Hydroxides are chemical compounds containing a hydroxy group or salts containing hydroxide (OH(-))." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oxoacid rdfs:subClassOf :hydroxides ;
    :has_definition "A compound which contains oxygen, at least one other element, and at least one hydrogen bound to oxygen, and which produces a conjugate base by loss of positive hydrogen ion(s) (hydrons)." ;
    :has_exact_synonym "oxoacid",
        "oxoacids" ;
    :has_related_synonym "oxacids",
        "oxiacids",
        "oxo acid",
        "oxy-acids",
        "oxyacids" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:inorganic_molecular_entity rdfs:subClassOf :molecular_entity ;
    :has_definition "A molecular entity that contains no carbon." ;
    :has_related_synonym "anorganische Verbindungen",
        "inorganic compounds",
        "inorganic entity",
        "inorganic molecular entities",
        "inorganics" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:salt rdfs:subClassOf :heteroatomic_molecular_entity ;
    :has_definition "A salt is an assembly of cations and anions." ;
    :has_exact_synonym "salt" ;
    :has_related_synonym "Salz",
        "Salze",
        "ionic compound",
        "ionic compounds",
        "sal",
        "sales",
        "salts",
        "sel",
        "sels" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ion rdfs:subClassOf :molecular_entity ;
    :has_definition "A molecular entity having a net electric charge." ;
    :has_exact_synonym "Ion",
        "ion" ;
    :has_related_synonym "Ionen",
        "iones",
        "ions" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iron_molecular_entity rdfs:subClassOf :iron_group_molecular_entity ;
    :has_exact_synonym "iron molecular entity" ;
    :has_related_synonym "iron compounds",
        "iron molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:elemental_molecule rdfs:subClassOf :elemental_molecular_entity,
        :molecule ;
    :has_definition "A molecule all atoms of which have the same atomic number." ;
    :has_related_synonym "homoatomic molecule",
        "homoatomic molecules" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:molecule rdfs:subClassOf :polyatomic_entity ;
    :has_definition "Any polyatomic entity that is an electrically neutral entity consisting of more than one atom." ;
    :has_exact_synonym "molecule" ;
    :has_related_synonym "Molekuel",
        "molecula",
        "molecules",
        "neutral molecular compounds" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oxide rdfs:subClassOf :heteroatomic_molecular_entity,
        :oxygen_molecular_entity ;
    :has_definition "An oxide is a chemical compound of oxygen with other chemical elements." ;
    :has_exact_synonym "oxide" ;
    :has_related_synonym "oxides" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oxygen_molecular_entity rdfs:subClassOf :chalcogen_molecular_entity ;
    :has_exact_synonym "oxygen molecular entity" ;
    :has_related_synonym "oxygen molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:phosphate rdfs:subClassOf :phosphoric_acid_derivative ;
    :has_definition "Salts and esters of phosphoric and oligophosphoric acids and their chalcogen analogues. In inorganic chemistry, the term is also used to describe anionic coordination entities with phosphorus as central atom." ;
    :has_exact_synonym "phosphates" ;
    :has_related_synonym "phosphates" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sulfur_molecular_entity rdfs:subClassOf :chalcogen_molecular_entity ;
    :has_exact_synonym "sulfur molecular entity" ;
    :has_related_synonym "sulfur molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ammonium rdfs:subClassOf :monovalent_inorganic_cation,
        :nitrogen_hydride,
        :onium_cation ;
    :has_definition "An onium cation obtained by protonation of ammonia." ;
    :has_exact_synonym "ammonium",
        "azanium" ;
    :has_related_synonym "Ammonium(1+)",
        "NH4(+)",
        "NH4+",
        "[NH4](+)",
        "ammonium cation",
        "ammonium ion" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:application rdfs:subClassOf :role ;
    :has_definition "Intended use of the molecular entity or part thereof by humans." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atom rdfs:subClassOf :chemical_entity ;
    :has_definition "A chemical entity constituting the smallest component of an element having the chemical properties of the element." ;
    :has_exact_synonym "atom" ;
    :has_related_synonym "atome",
        "atomo",
        "atoms",
        "atomus",
        "element",
        "elements" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:elemental_molecular_entity rdfs:subClassOf :molecular_entity ;
    :has_definition "A molecular entity all atoms of which have the same atomic number." ;
    :has_related_synonym "homoatomic entity",
        "homoatomic molecular entities",
        "homoatomic molecular entity" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polyatomic_anion rdfs:subClassOf :anion,
        :polyatomic_ion ;
    :has_definition "An anion consisting of more than one atom." ;
    :has_related_synonym "polyatomic anions" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nutrient rdfs:subClassOf :food_component ;
    :has_definition "A nutrient is a food component that an organism uses to survive and grow." ;
    :has_related_synonym "nutrients" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heteroorganic_entity rdfs:subClassOf :organic_molecular_entity ;
    :has_definition "A heteroorganic entity is an organic molecular entity in which carbon atoms or organic groups are bonded directly to one or more heteroatoms." ;
    :has_related_synonym "heteroorganic entities",
        "organoelement compounds" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:agrochemical rdfs:subClassOf :application ;
    :has_definition "An agrochemical is a substance that is used in agriculture or horticulture." ;
    :has_related_synonym "agrichemical",
        "agrichemicals",
        "agricultural chemicals",
        "agrochemicals" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fertilizer rdfs:subClassOf :agrochemical ;
    :has_definition "A fertilizer is any substance that is added to soil or water to assist the growth of plants." ;
    :has_related_synonym "fertiliser",
        "fertilizers" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alkali_metal_molecular_entity rdfs:subClassOf :s_block_molecular_entity ;
    :has_definition "A molecular entity containing one or more atoms of an alkali metal." ;
    :has_related_synonym "alkali metal molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pnictogen rdfs:subClassOf :p_block_element_atom ;
    :has_definition "Any p-block element atom that is in group 15 of the periodic table: nitrogen, phosphorus, arsenic, antimony and bismuth." ;
    :has_exact_synonym "pnictogens" ;
    :has_related_synonym "group 15 elements",
        "group V elements",
        "nitrogenoideos",
        "nitrogenoides",
        "pnictogene",
        "pnictogenes" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pnictogen_molecular_entity rdfs:subClassOf :p_block_molecular_entity ;
    :has_definition "A p-block molecular entity containing any pnictogen." ;
    :has_exact_synonym "pnictogen molecular entity" ;
    :has_related_synonym "pnictogen molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chalcogen_molecular_entity rdfs:subClassOf :p_block_molecular_entity ;
    :has_definition "Any p-block molecular entity containing a chalcogen." ;
    :has_exact_synonym "chalcogen molecular entity" ;
    :has_related_synonym "chalcogen compounds",
        "chalcogen molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carbon_group_element_atom rdfs:subClassOf :p_block_element_atom ;
    :has_exact_synonym "group 14 elements" ;
    :has_related_synonym "carbon group element",
        "carbon group elements",
        "carbonoides",
        "cristallogene",
        "cristallogenes",
        "group IV elements" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:main_group_element_atom rdfs:subClassOf :atom ;
    :has_definition "An atom belonging to one of the main groups (found in the s- and p- blocks) of the periodic table." ;
    :has_exact_synonym "main group elements" ;
    :has_related_synonym "Hauptgruppenelement",
        "Hauptgruppenelemente",
        "main group element" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iron_group_element_atom rdfs:subClassOf :d_block_element_atom ;
    :has_exact_synonym "group 8 elements" ;
    :has_related_synonym "iron group element",
        "iron group elements" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sulfur_oxoanion rdfs:subClassOf :chalcogen_oxoanion,
        :sulfur_molecular_entity ;
    :has_exact_synonym "sulfur oxoanion" ;
    :has_related_synonym "oxoanions of sulfur",
        "sulfur oxoanions" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:transition_element_molecular_entity rdfs:subClassOf :molecular_entity ;
    :has_definition "A molecular entity containing one or more atoms of a transition element." ;
    :has_related_synonym "transition element molecular entities",
        "transition metal molecular entity" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:metal_atom rdfs:subClassOf :atom ;
    :has_definition "An atom of an element that exhibits typical metallic properties, being typically shiny, with high electrical and thermal conductivity." ;
    :has_related_synonym "elemental metal",
        "elemental metals",
        "metal element",
        "metal elements",
        "metals" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:p_block_element_atom rdfs:subClassOf :main_group_element_atom ;
    :has_definition "Any main group element atom belonging to the p-block of the periodic table." ;
    :has_related_synonym "p-block element",
        "p-block elements" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:main_group_molecular_entity rdfs:subClassOf :molecular_entity ;
    :has_definition "A molecular entity containing one or more atoms from any of groups 1, 2, 13, 14, 15, 16, 17, and 18 of the periodic table." ;
    :has_related_synonym "main group compounds",
        "main group molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carbon_group_molecular_entity rdfs:subClassOf :p_block_molecular_entity ;
    :has_exact_synonym "carbon group molecular entity" ;
    :has_related_synonym "carbon group molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cyclic_compound rdfs:subClassOf :molecule ;
    :has_definition "Any molecule that consists of a series of atoms joined together to form a ring." ;
    :has_related_synonym "cyclic compounds" .
